import React from "react";
import DashboardLayout from "../layouts/DashboardLayout";
import "../styles/dashboard.css"; // Make sure styles are loaded

const DashboardPage = () => {
    return (
        <DashboardLayout>
            <div className="contents">
                <div className="first">
                    <img src="/images/Untitled design (1).jpg" alt="File Upload" />
                    <h3>Choose a file or drag it here</h3>
                </div>
                <div className="arrow">
                    <img src="/images/back-arrow-icon.png" alt="Back Arrow" />
                </div>
                <div className="second">
                    <h3>PDF File</h3>
                    <img src="/images/pngkey.com-pdf-icon-png-6540916.png" alt="PDF Icon" />
                    <h4>Drag and drop the file to the left to experience OriginStamp</h4>
                </div>
            </div>
        </DashboardLayout>
    );
};

export default DashboardPage;
